import React from 'react';
import '../css/TermsOfUse.css';

function TermsOfUse() {
    return (
        <div className="terms-of-use">
            <div className="dflex jc-center">
                <div className="w74">
                    <h6>
                    Şərtlər və Qaydalar: <br></br>
Bu sənəd 2000-ci il İnformasiya Texnologiyaları Qanununa əsasən elektron qeyddir və orada tətbiq oluna bilən qaydalar və Hindistan qanunlarına əsasən müxtəlif qanunlarda elektron qeydlərə aid düzəliş edilmiş müddəalardır. Bu elektron qeyd kompüter sistemi tərəfindən yaradılır və heç bir fiziki və ya rəqəmsal imza tələb etmir.
Bu sənəd nəşr olunur və 2011-ci il İnformasiya Texnologiyaları (Vasitəçilər təlimatları) Qaydalarının 3-cü Qaydasının (1) müddəalarına uyğun olaraq şərh edilir və bu qaydalar və qaydaların, məxfilik siyasətinin və www. theconstructionstore.in saytında.
                    </h6>
                </div>
            </div>
        </div>
    )
}

export default TermsOfUse
